import About from "./pages/aboutMe"

function App() {
  const [data, setData] = React.useState(null);

  React. useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <h1> Shyft </h1>
      <p>{!data ? "Loading..." : data}</p>
    </div>
  );
}

export default App;
